import React from "react";
import classes from './Overview.module.css'
const Overview = (props) => {
  return(
  <section className={classes.overview}>
    <h2 >Need Referral ? Or Tips For Cracking Your Upcoming Interview</h2>
    <p>
      Connect to your Dream company emmploye, Who passed out from your University
    </p>

    <p>All You have to do is to just Click LINKEDIN Button and Connect to them By their Linkedin id  </p>
  </section>);
};
export default Overview;
